use ahash::AHashMap;

use crate::prelude::*;

pub fn add_variants(repo: &mut RunnerRepository) {
    repo.add_variant("part1", part1);
    repo.add_variant("part1_cached", part1_cached);
    repo.add_variant("part2", part2);
    repo.add_variant("generate_lut", generate_lut);
}

fn split_digits(n: u64) -> Option<(u64, u64)> {
    let mut k = 0;
    let mut t = n;
    while t > 0 {
        t /= 10;
        k += 1;
    }

    if k % 2 != 0 {
        return None;
    }

    let p = 10u64.pow(k / 2);
    Some((n / p, n % p))
}

fn part1(ctx: &mut RunContext) -> eyre::Result<impl Display> {
    let mut front = vec![];
    let mut back = vec![];

    let mut sum = 0;
    for num in ctx.input.split_whitespace() {
        front.clear();
        back.clear();
        front.push(num.parse::<u64>()?);
        for _ in 0..25 {
            for &num in &front {
                if num == 0 {
                    back.push(1);
                } else if let Some((l, r)) = split_digits(num) {
                    back.push(l);
                    back.push(r);
                } else {
                    back.push(num * 2024);
                }
            }
            front.clear();
            std::mem::swap(&mut front, &mut back);
        }
        sum += front.len();
    }

    Ok(sum)
}

fn seq_count<const MAX_DEPTH: u8>(cache: &mut AHashMap<u64, u64>, num: u64, depth: u8) -> u64 {
    if depth == MAX_DEPTH {
        // base case
        return 1;
    }
    if num < 100 {
        let depth_ix = 75 - MAX_DEPTH + depth;
        return LUT75[depth_ix as usize][num as usize];
    }

    let key = num | (depth as u64) << 56;

    if let Some(&cached) = cache.get(&key) {
        return cached;
    }

    let res = if num == 0 {
        seq_count::<MAX_DEPTH>(cache, 1, depth + 1)
    } else if let Some((l, r)) = split_digits(num) {
        seq_count::<MAX_DEPTH>(cache, l, depth + 1) + seq_count::<MAX_DEPTH>(cache, r, depth + 1)
    } else {
        seq_count::<MAX_DEPTH>(cache, num * 2024, depth + 1)
    };

    cache.insert(key, res);
    res
}

fn part1_cached(ctx: &mut RunContext) -> eyre::Result<impl Display> {
    let mut sum = 0;
    let mut cache = AHashMap::with_capacity(200_000);
    for num in ctx.input.split_whitespace() {
        sum += seq_count::<25>(&mut cache, num.parse::<u64>()?, 0);
    }
    Ok(sum)
}

fn part2(ctx: &mut RunContext) -> eyre::Result<impl Display> {
    let mut sum = 0;
    let mut cache = AHashMap::with_capacity(200_000);
    for num in ctx.input.split_whitespace() {
        sum += seq_count::<75>(&mut cache, num.parse::<u64>()?, 0);
    }

    Ok(sum)
}

